from <package>.types.<typename>.parameter.entrypoint_bar import EntryPointBarParameter
from <package>.types.<typename>.storage import TypeNameStorage async def on_transaction( ctx: HandlerContext, entrypoint_foo: Transaction[EntryPointFooParameter, TypeNameStorage], entrypoint_bar: Transaction[EntryPointBarParameter, TypeNameStorage]
