The era of handling chain reorgs manually is finally over! Now when DipDup receives a reorg message from TzKT it just rewinds a database to the previous state reverting changes in backtracked blocks level by level. To make this possible, DipDup catches all database modifications and saves diffs in a separate table, dipdup_model_update (you don't need to access it directly). # INSERT saved with no data, just drop this row on reorg.
trader = Trader(name='Alice', balance=100, active=True)
await trader.save() # UPDATE saved with data old values to set them on reorg.
# Diff: {'balance': 100}
trader.balance = 200
await trader.save() # DELETE saved with full copy of data. On reorg this row will be recreated with the same PK.
# Diff: {'name': 'Alice', 'balance': 200, 'active': True}
await trader.delete() Bulk class methods like bulk_insert and bulk_update are supported too. However, for raw queries, DipDup uses prefetching (additional SELECT) to save original values. So, ReallyHugeTable.filter().delete() will create efficiently a full copy of the table in dipdup_model_update. Most likely you will never need to perform such queries in handlers, but keep that detail in mind. Since the Ithacanet protocol, only two last blocks may be backtracked. We do not need to store older diffs, they are removed automatically. If you need to keep more levels or disable this feature, adjust rollback_depth config option. advanced: rollback_depth: 2 # 0 to disable on_index_rollback event hook now looks like this: from dipdup.context import HookContext
from dipdup.index import Index async def on_index_rollback( ctx: HookContext, index: Index, # type: ignore[type-arg] from_level: int, to_level: int,
) -> None: await ctx.execute_sql('on_index_rollback') await ctx.rollback( index=index.name, from_level=from_level, to_level=to_level, ) TzKT buffer_size option remains available, but it's not required to handle chain reorgs anymore.

