Everything's ready to implement an actual indexer logic. Our task is to index all the balance updates, so we'll start with a helper method to handle them. Create a file named on_balance_update.py in the handlers package with the following content: from datetime import datetime
from decimal import Decimal import demo_token.models as models async def on_balance_update( address: str, balance_update: Decimal, timestamp: datetime,
) -> None: holder, _ = await models.Holder.get_or_create(address=address) holder.balance += balance_update holder.turnover += abs(balance_update) holder.tx_count += 1 holder.last_seen = timestamp await holder.save() Three methods of tzBTC contract can alter token balances — transfer, mint, and burn. The last one is omitted in this tutorial for simplicity. Edit corresponding handlers to call the on_balance_update method with data from matched operations: on_transfer.py from decimal import Decimal from demo_token.handlers.on_balance_update import on_balance_update
from demo_token.types.tzbtc.parameter.transfer import TransferParameter
from demo_token.types.tzbtc.storage import TzbtcStorage
from dipdup.context import HandlerContext
from dipdup.models import Transaction async def on_transfer( ctx: HandlerContext, transfer: Transaction[TransferParameter, TzbtcStorage],
) -> None: if transfer.parameter.from_ == transfer.parameter.to: # NOTE: Internal tzBTC transfer return amount = Decimal(transfer.parameter.value) / (10**8) await on_balance_update( address=transfer.parameter.from_, balance_update=-amount, timestamp=transfer.data.timestamp, ) await on_balance_update( address=transfer.parameter.to, balance_update=amount, timestamp=transfer.data.timestamp, ) on_mint.py from decimal import Decimal from demo_token.handlers.on_balance_update import on_balance_update
