from dipdup.models import Transaction async def on_mint( ctx: HandlerContext, mint: Transaction[MintParameter, TzbtcStorage],
) -> None: amount = Decimal(mint.parameter.value) / (10**8) await on_balance_update( address=mint.parameter.to, balance_update=amount, timestamp=mint.data.timestamp, ) And that's all! We can run the indexer now. See Also 2.6. Implementing handlers
